import NavIcon from './Icons/NavIcon.jsx'
import { IconSettings } from '@tabler/icons-react';
import { faLinkedin, faGithub } from '@fortawesome/free-brands-svg-icons';

function NavBar() {
    return (
        <div class="flex flex-col items-start mt-2">
            <div class="flex flex-row justify-start items-center rounded-lg bg-neutral-700 w-full pl-2">
                <IconSettings class="border-r-2 pr-5 border-white" color={"white"} size={44}/>
                <div class="border-r-2 pr-5 border-white text-4xl text-white w-2"></div>
                <div class="flex flex-row gap-4 pl-5">
                    <NavIcon icon={faLinkedin} name="LinkedIn" link="https://www.linkedin.com/in/nicholasangelici/"/>
                    <NavIcon icon={faGithub} name="Github" link="https://github.com/NickCoding22"/>
                </div>
            </div>
        </div>
    )
}

export default NavBar;
